/* eslint-disable prettier/prettier */
import styled from 'styled-components';

const IndexGrid = styled.div`
  * {
    display: grid;
    grid-gap: 0;
  }

  #slideshow {
    grid-column: 1 / span 5;
    grid-row: 1;
  }
`;

export default IndexGrid;
